import React from "react";
import PropTypes from "prop-types";
import { withTranslation } from 'config/i18n'

const Header = ({t}) => {
	return (
		<>
			<div>Header created. Translation: {t("homepage")}</div>
		</>
	);
};

Header.propTypes = {};

export default withTranslation()(Header);
